package Loops;

public class nestedWhile {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int num = 1;
		int num1=1;
		
		while (num <=5) {
			
			while ( num1 <=5)
			{
				
				
				System.out.print(num1);
				
				num1++;
				
				
				
			} 
			
			System.out.println();
			
			num1 = 1 ;
			
			num++;
			
			
			
		}
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
		
	}

}
